const GamePlayInfo = () => {
    return (
        <nav className='gamePlayInfo'>
            <div className='timeLeft'>
                <span>Time left: </span><span>09</span></div>

            <div className='gameScore'>Score: 10</div>
            <div className='gameAttempt'>
                <span>5</span>
            </div>
            
        </nav>
    )
}

export default GamePlayInfo
